-- ----------------------------
-- Table structure for t_trainingplan
-- ----------------------------
CREATE TABLE `t_trainingplan` (
  `trainingPlanId` bigint(14) NOT NULL AUTO_INCREMENT COMMENT '培养方案ID',
  `trainingPlanDepId` bigint(14) DEFAULT NULL,
